import React, { useState } from 'react';
import { Menu } from '@lucide/react'; // Or any other Lucide icons you want to use

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => setIsMobileMenuOpen(!isMobileMenuOpen);

  return (
    <nav className="bg-white shadow-md">
      <div className="container mx-auto px-4 py-3 flex justify-between items-center">
        {/* Logo */}
        <div className="text-xl font-bold">Your Logo</div>

        {/* Desktop Navigation */}
        <ul className="hidden md:flex space-x-4">
          <li><a href="#" className="text-gray-800 hover:text-blue-500">Home</a></li>
          <li><a href="#" className="text-gray-800 hover:text-blue-500">About</a></li>
          <li><a href="#" className="text-gray-800 hover:text-blue-500">Services</a></li>
          <li><a href="#" className="text-gray-800 hover:text-blue-500">Contact</a></li>
        </ul>

        {/* Mobile Menu Button */}
        <button className="md:hidden" onClick={toggleMobileMenu}>
          <Menu className="h-6 w-6" />
        </button>

        {/* Mobile Menu */}
        {isMobileMenuOpen && (
          <div className="md:hidden absolute top-full left-0 w-full bg-white shadow-lg py-2">
            <ul className="space-y-2">
              <li><a href="#" className="block px-4 py-2 text-gray-800 hover:text-blue-500">Home</a></li>
              <li><a href="#" className="block px-4 py-2 text-gray-800 hover:text-blue-500">About</a></li>
              <li><a href="#" className="block px-4 py-2 text-gray-800 hover:text-blue-500">Services</a></li>
              <li><a href="#" className="block px-4 py-2 text-gray-800 hover:text-blue-500">Contact</a></li>
            </ul>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
